import React, { useState } from 'react';
import { View, Text, Image, StyleSheet, TouchableOpacity, Picker } from 'react-native';

const HelpRequestForm = () => {
  const [typeOfHelp, setTypeOfHelp] = useState('');
  const [disabledVehicle, setDisabledVehicle] = useState('');
  const [selectedDay, setSelectedDay] = useState('');
  const [preferredHours, setPreferredHours] = useState('');

  return (
    <View style={styles.container}>
      <Image source={require('/images/logo.png')} style={styles.image} />
      <View style={styles.form}>
        <View style={styles.formGroup}>
          <Text style={styles.label}>Type of Help</Text>
          <Picker
            selectedValue={typeOfHelp}
            onValueChange={(itemValue) => setTypeOfHelp(itemValue)}
            style={styles.picker}
          >
            <Picker.Item label="Select an option" value="" />
            <Picker.Item label="Transporting Patients" value="transporting" />
            <Picker.Item label="Transferring Packages" value="transferring" />
            <Picker.Item label="Keeping in a Hospital" value="keeping" />
          </Picker>
        </View>
        <View style={styles.formGroup}>
          <Text style={styles.label}>Do you need a disabled vehicle?</Text>
          <Picker
            selectedValue={disabledVehicle}
            onValueChange={(itemValue) => setDisabledVehicle(itemValue)}
            style={styles.picker}
          >
            <Picker.Item label="Select an option" value="" />
            <Picker.Item label="Yes" value="yes" />
            <Picker.Item label="No" value="no" />
          </Picker>
        </View>
        <View style={styles.formGroup}>
          <Text style={styles.label}>What day do you need the help?</Text>
          <Picker
            selectedValue={selectedDay}
            onValueChange={(itemValue) => setSelectedDay(itemValue)}
            style={styles.picker}
          >
            <Picker.Item label="Select a day" value="" />
            <Picker.Item label="ראשון" value="ראשון" />
            <Picker.Item label="שני" value="שני" />
            <Picker.Item label="שלישי" value="שלישי" />
            <Picker.Item label="רביעי" value="רביעי" />
            <Picker.Item label="חמישי" value="חמישי" />
            <Picker.Item label="שישי" value="שישי" />
          </Picker>
        </View>
        <View style={styles.formGroup}>
          <Text style={styles.label}>Preferred Hours</Text>
          <Picker
            selectedValue={preferredHours}
            onValueChange={(itemValue) => setPreferredHours(itemValue)}
            style={styles.picker}
          >
            <Picker.Item label="Select an option" value="" />
            <Picker.Item label="שעות בוקר," value="morning" />
            <Picker.Item label="שעות צהריים" value="שעות צהריים" />
            <Picker.Item label="שעות אחר הצהריים" value="שעות אחר הצהריים" />
            <Picker.Item label="שעות הערב" value="שעות הערב" />
            <Picker.Item label="בלילה " value="בלילה " />
          </Picker>
        </View>
        <TouchableOpacity style={styles.button}>
          <Text style={styles.buttonText}>Submit</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  image: {
    width: '100%',
    height: 150,
    marginBottom: 20,
  },
  form: {
    width: '80%',
  },
  formGroup: {
    marginBottom: 20,
  },
  label: {
    fontWeight: 'bold',
    marginBottom: 10,
  },
  picker: {
    borderWidth: 1,
    borderColor: '#ccc',
    borderRadius: 5,
    height: 40,
  },
  button: {
    backgroundColor: '#007AFF',
    borderRadius: 5,
    height: 40,
    alignItems: 'center',
    justifyContent: 'center',
  },
  buttonText: {
    color: '#fff',
    fontWeight: 'bold',
  },
});

export default HelpRequestForm;
